import React from 'react';

export default NavBar = () => {
    return( 
        <div>
            <nav>
                <ul>
                    <li> <a href="/test">Home</a> </li>
                    <li> <a href="">About</a> </li>
                    <li> <a href="">Blog</a> </li>
                    <li> <a href="">Contact</a> </li>
                </ul>
            </nav>
        </div>
    )
}
